size_t GetMemUsage()
{
    MEMORY_BASIC_INFORMATION crt = { 0 };
    size_t total = 0;

#ifdef ENV32BIT
    const PBYTE MaxAddress = (PBYTE)0x7FFFFFFF;
#else
    const PBYTE MaxAddress = (PBYTE)0x7FFFFFFFFFFFFFFFULL;
#endif

    PBYTE addr = 0;
    size_t i = 0;

    while (addr < MaxAddress)
    {
        memset(&crt, 0, sizeof(crt));
        if (VirtualQuery(addr, &crt, sizeof(MEMORY_BASIC_INFORMATION)) <= 0)
            break;
        addr += crt.RegionSize;
        if (crt.State == MEM_FREE)
            continue;
        if ((crt.State & MEM_COMMIT) == MEM_COMMIT)
            total += crt.RegionSize;
    }

    return total;
}

int main()
{	
    size_t m1 = GetMemUsage();
    P1();
    size_t m2 = GetMemUsage();
    P2();
    size_t m3 = GetMemUsage();

    printf("m1=%08X\n", m1);
    printf("m2=%08X\n", m2);
    printf("m3=%08X\n", m3);

    if ((abs((int)m1 - (int)m2) < 0x3000) && m2 == m3)
        printf("PASSED");
    else
        printf("FAILED");
	return 0;
}

